import React from 'react';
import { Box, TextField, Button, Typography } from '@mui/material';

const Chat = () => {
    return (
        <Box>
            <Typography variant="h5" gutterBottom>Chat</Typography>
            <Box>
                <TextField label="Message" fullWidth variant="outlined" margin="normal" />
                <Button variant="contained" color="primary">Envoyer</Button>
            </Box>
        </Box>
    );
};

export default Chat;
